(34422, '8F493049-F35D-4BF3-8FFF-22DB88B49AD5', 'Thanks love for all of this! Please keep sending notes while I️’m away. Our polysecure checklist works! And you make me feel strong and fortified every day. And that gives me the courage to grow where my edges are too.   At climb Hire, we are obsessed right now with giving and asking for feedback. I️ realized this weekend that you and I️ have really built this culture for ourselves too. You are exceptional at receiving feedback and following through. It’s what makes me so confident in us and in this new 2.0 marriage we are building. You take it in and you act immediately. Thank you for working on this. It was not our strongest suit in our 1.0 version and it’s why we were hiding and feeling ashamed. I️’m grateful that more and more of our feelings get surfaced and come to the forefront. And that we both can be raw in those emotions. There are also times where I️ have multiple emotions that directly conflict with one another. Doron - I️’m excited for you to feel what expansiveness and connection feels like, because I️ know firsthand how powerful those feelings are. And I️’m also jealous and working through my anxiety of wanting you to myself. You hear and see both sides and appreciate the contradictions that live in both emotions and understand “both can be true.” Thanks for hearing and seeing me. I️ love you so so very much. ', 'Nitzan', 'David', '2021-10-04T08:05:06.612554'),
